import { Box, Text } from "@chakra-ui/react";

const CartPageData = () => {
  return (
    <>
      <CartPageInitialComponent />
    </>
  );
};

export default CartPageData;

const CartPageInitialComponent = () => {
  return (
    <>
      <Box>
        <Text fontSize={"6xl"} fontWeight={''}>Cart Items</Text>
      </Box>
    </>
  );
};
